import React, { useState, useEffect } from 'react';
import './dash.css';
import logo from "../image/logo.png";

function Dashboard() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isDarkTheme, setIsDarkTheme] = useState(false);

  useEffect(() => {
    if (isDarkTheme) {
      document.body.classList.add('dark-theme-variables');
    } else {
      document.body.classList.remove('dark-theme-variables');
    }
  }, [isDarkTheme]);

  return (
    <div className="container">
      <aside style={{ display: isMenuOpen ? 'block' : 'none' }}>
        <div className="top">
          <div className="logo1">
            <img src={logo} alt="Logo" />
          </div>
          <div className="close" onClick={() => setIsMenuOpen(false)}>
            <span className="material-symbols-sharp">close</span>
          </div>
        </div>
        <div className="sidebar">
          <a href="#"><span className="material-symbols-sharp">grid_view</span><h3>Dashboard</h3></a>
          <a href="#" className="active"><span className="material-symbols-sharp">person_outline</span><h3>Customers</h3></a>
          <a href="#"><span className="material-symbols-sharp">insights</span><h3>Analytics</h3></a>
          <a href="#"><span className="material-symbols-sharp">mail_outline</span><h3>Messages</h3><span className="msg_count">14</span></a>
          <a href="#"><span className="material-symbols-sharp">receipt_long</span><h3>Products</h3></a>
          <a href="#"><span className="material-symbols-sharp">report_gmailerrorred</span><h3>Reports</h3></a>
          <a href="#"><span className="material-symbols-sharp">settings</span><h3>Settings</h3></a>
          <a href="#"><span className="material-symbols-sharp">add</span><h3>Add Product</h3></a>
          <a href="#"><span className="material-symbols-sharp">logout</span><h3>Logout</h3></a>
        </div>
      </aside>
      <main>
        <h1>Dashboard</h1>
        <div className="date"><input type="date" /></div>
      </main>
      <div className="right">
        <div className="top">
          <button onClick={() => setIsMenuOpen(true)}>
            <span className="material-symbols-sharp">menu</span>
          </button>
          <div className="theme-toggler" onClick={() => setIsDarkTheme(!isDarkTheme)}>
            <span className={`material-symbols-sharp ${!isDarkTheme ? 'active' : ''}`}>light_mode</span>
            <span className={`material-symbols-sharp ${isDarkTheme ? 'active' : ''}`}>dark_mode</span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
